// src/admin-pages/AdminTrusted.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  FaTrash,
  FaUserShield,
  FaPlusCircle,
  FaUserCheck,
  FaUserTag,
} from 'react-icons/fa';

const API = axios.create({
  baseURL: 'http://localhost:5000/api/trusted', // ✅ Correct base URL
});

const AdminTrusted = () => {
  const [trustedPersons, setTrustedPersons] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    position: '',
    description: '',
    image: null,
  });

  const fetchTrustedPersons = async () => {
    try {
      const res = await API.get('/');
      setTrustedPersons(res.data);
    } catch (error) {
      console.error('Error fetching trusted persons:', error);
    }
  };

  useEffect(() => {
    fetchTrustedPersons();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const uploadData = new FormData();
      uploadData.append('name', formData.name);
      uploadData.append('position', formData.position);
      uploadData.append('description', formData.description);
      uploadData.append('image', formData.image);

      const res = await API.post('/', uploadData);
      setTrustedPersons([res.data, ...trustedPersons]);
      setFormData({ name: '', position: '', description: '', image: null });
    } catch (error) {
      console.error('Upload failed:', error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await API.delete(`/${id}`);
      setTrustedPersons(trustedPersons.filter((p) => p._id !== id));
    } catch (error) {
      console.error('Delete failed:', error);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4 flex items-center gap-2">
        <FaUserShield /> Trusted Persons
      </h2>

      <form onSubmit={handleSubmit} className="mb-6 grid grid-cols-1 gap-4 md:grid-cols-2">
        <input
          type="text"
          placeholder="Name"
          required
          value={formData.name}
          onChange={(e) => setFormData({ ...formData, name: e.target.value })}
          className="p-2 border rounded"
        />
        <input
          type="text"
          placeholder="Position"
          required
          value={formData.position}
          onChange={(e) => setFormData({ ...formData, position: e.target.value })}
          className="p-2 border rounded"
        />
        <textarea
          placeholder="Description"
          required
          value={formData.description}
          onChange={(e) => setFormData({ ...formData, description: e.target.value })}
          className="p-2 border rounded md:col-span-2"
        />
        <input
          type="file"
          required
          onChange={(e) => setFormData({ ...formData, image: e.target.files[0] })}
          className="p-2 border rounded md:col-span-2"
        />
        <button
          type="submit"
          className="bg-blue-600 text-white px-4 py-2 rounded flex items-center gap-2 md:col-span-2"
        >
          <FaPlusCircle /> Add Trusted Person
        </button>
      </form>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {trustedPersons.map((person) => (
          <div key={person._id} className="p-4 border rounded shadow">
            <img
              src={`http://localhost:5000${person.image}`}
              alt={person.name}
              className="w-full h-48 object-cover rounded mb-2"
            />
            <h3 className="text-lg font-semibold flex items-center gap-2">
              <FaUserCheck /> {person.name}
            </h3>
            <p className="text-sm text-gray-700 flex items-center gap-2">
              <FaUserTag /> {person.position}
            </p>
            <p className="text-sm mt-2">{person.description}</p>
            <button
              onClick={() => handleDelete(person._id)}
              className="mt-3 bg-red-500 text-white px-3 py-1 rounded flex items-center gap-2"
            >
              <FaTrash /> Delete
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminTrusted;
